import { Button, createStyles, makeStyles, Theme } from "@material-ui/core";
import React from "react";
import {
  Form,
  FormGroup,
  Input,
  Label,
  Row,
} from "reactstrap";
import styled from "styled-components";

import * as Styled from './Contact.style'

function Contact() {
  const classes = makeStyles((theme: Theme) =>
        createStyles({
            containedPrimary: {
                backgroundColor: '#FF4A15',
                '&:hover': {
                    backgroundColor: '#EC400D',
            },
              width: '100%',
            marginBottom: '2rem',
              fontFamily: `'Alatsi', sans-serif`,
            },
        }),
  );
  
  return (
    <Styled.Container>
    <Row>
        <Styled.Title>
            <h1>CONTÁCTENOS</h1>
        </Styled.Title>
    </Row>
    <Styled.FormContainer>
        <Form>
          <FormGroup>
            <Label for="nameInput">Nombre</Label>
            <Input type="text" name="name" id="nameInput" placeholder="Ingrese su nombre completo" />
          </FormGroup>
          <FormGroup>
            <Label for="emailInput">Correo electrónico</Label>
            <Input type="email" name="email" id="emailInput" placeholder="Ingrese su correo electrónico" />
          </FormGroup>
          <FormGroup>
            <Label for="messageInput">Mensaje</Label>
            <Input type="textarea" name="text" id="messageInput" />
          </FormGroup>
          <Button className={classes().containedPrimary} variant="contained" color="primary">ENVIAR</Button>
        <Styled.ContactContainer>
          <p className="phone-number"><span><i className="fas fa-phone"></i></span> <b>2268-0044</b> </p>
          <p><span><i className="fas fa-envelope"></i></span> <b> soporte@iot3k.com </b> </p>
        </Styled.ContactContainer>
        </Form>
    </Styled.FormContainer>
</Styled.Container>
  )
}

export default Contact
